import React from "react";
import styled from "styled-components";
import about_page from "../images/about-page.jpg";


const PageContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const image = styled.img`
  width: 200px;
  height: 200px;
  margin-bottom: 20px;
`;

const Text = styled.p`
  text-align: center;
`;

function About() {
    return (
        <PageContainer>
            <image src={about_page} alt="About Page" />
            <Text>
                This project is created to help users have an easier time finding recipes based on what they have in the fridge. In addition to the recipes, we have included a function to find restaurants around them.
            </Text>
        </PageContainer>
    );
}

export default About;
